import React, { useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./style/swiperActual.css";
import { Navigation } from "swiper";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";

import stat from "../../image/icone/statistic.png";
import like from "../../image/icone/like.png";

import iP14ProMax1TBSilver from "../../image/products/iPhone14ProMax1TBSilver.png";
import ip13256GBGreen from "../../image/products/iPhone13256GBGreen.png";
import ip14128GBMidnight from "../../image/products/iPhone14128GBMidnight.png";
import ip14256GBYellow from "../../image/products/iPhone14256GBYellow.png";
import iPSE64GB2022Midnight from "../../image/products/iPhoneSE64GB2022Midnight.png";
import iphone_11_red from "../../image/products/iphone_11_red.png";

export default function App() {
  const [data, setData] = useState([]);

  const fetchData = () => {
    fetch("http://localhost:3000/actualProduct")
      .then((response) => response.json())
      .then((jsonData) => setData(jsonData));
  };

  return (
    <section className="swiper">
      <div className="swiper__title">
        <h2>Актуальные предложения</h2>
      </div>
      <Swiper
        navigation={true}
        slidesPerView={4}
        spaceBetween={50}
        modules={[Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
          <div className="swiper__conteiner_img">
            <img
              src={require("../../image/products/iPhone14ProMax1TBSilver.png")}
              alt="sad"
            />
          </div>
          <div>
            <div className="swiper__titles">
              <span>Apple iPhone 13 mini 256GB (PRODUCT) Red</span>
            </div>
            <p>36 000 ua</p>
            <div className="swider_item_do">
              <button className="product__btn">В корзину</button>
              <img src={stat} alt="404" />
              <img src={like} alt="404" />
            </div>
          </div>
        </SwiperSlide>
      </Swiper>
    </section>
  );
}
